import React, { useEffect, useState } from 'react';
import api from './api/config';

function App() {
  const [patients, setPatients] = useState([]);
  const [medications, setMedications] = useState([]);
  const [activities, setActivities] = useState([]);
  const [caretakers, setCaretakers] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    setLoading(true);
    Promise.all([
      api.get('/patients'),
      api.get('/medications'),
      api.get('/activities'),
      api.get('/caretakers')
    ])
      .then(([patientsRes, medicationsRes, activitiesRes, caretakersRes]) => {
        setPatients(patientsRes.data);
        setMedications(medicationsRes.data);
        setActivities(activitiesRes.data);
        setCaretakers(caretakersRes.data);
        setError('');
      })
      .catch((err) => {
        setError('Failed to fetch data from backend');
        console.error(err);
      })
      .finally(() => setLoading(false));
  }, []);

  return (
    <div style={{ padding: '2rem', maxWidth: '1200px', margin: '0 auto' }}>
      <h1>Caretaker Dashboard</h1>
      {loading && <div>Loading data...</div>}
      {error && <div style={{ color: 'red', marginBottom: '1rem' }}>{error}</div>}

      <section>
        <h2>Patients</h2>
        <table border="1" cellPadding="8" style={{ width: '100%', marginBottom: '2rem' }}>
          <thead>
            <tr>
              <th>ID</th><th>Name</th><th>Age</th><th>Condition</th><th>Emergency Contact</th>
              <th>Last Checkup</th><th>Created At</th><th>Updated At</th>
            </tr>
          </thead>
          <tbody>
            {patients.map((p) => (
              <tr key={p.id}>
                <td>{p.id}</td>
                <td>{p.name}</td>
                <td>{p.age}</td>
                <td>{p.condition}</td>
                <td>{p.emergency_contact}</td>
                <td>{p.last_checkup}</td>
                <td>{p.created_at}</td>
                <td>{p.updated_at}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      <section>
        <h2>Medications</h2>
        <table border="1" cellPadding="8" style={{ width: '100%', marginBottom: '2rem' }}>
          <thead>
            <tr>
              <th>ID</th><th>Patient ID</th><th>Name</th><th>Dosage</th><th>Frequency</th>
              <th>Last Taken</th><th>Created At</th>
            </tr>
          </thead>
          <tbody>
            {medications.map((m) => (
              <tr key={m.id}>
                <td>{m.id}</td>
                <td>{m.patient_id}</td>
                <td>{m.name}</td>
                <td>{m.dosage}</td>
                <td>{m.frequency}</td>
                <td>{m.last_taken}</td>
                <td>{m.created_at}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      <section>
        <h2>Activities</h2>
        <table border="1" cellPadding="8" style={{ width: '100%', marginBottom: '2rem' }}>
          <thead>
            <tr>
              <th>ID</th><th>Patient ID</th><th>Type</th><th>Duration</th><th>Completed</th>
              <th>Activity Date</th><th>Notes</th><th>Created At</th>
            </tr>
          </thead>
          <tbody>
            {activities.map((a) => (
              <tr key={a.id}>
                <td>{a.id}</td>
                <td>{a.patient_id}</td>
                <td>{a.type}</td>
                <td>{a.duration}</td>
                <td>{a.completed ? 'Yes' : 'No'}</td>
                <td>{a.activity_date}</td>
                <td>{a.notes}</td>
                <td>{a.created_at}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      <section>
        <h2>Caretakers</h2>
        <table border="1" cellPadding="8" style={{ width: '100%', marginBottom: '2rem' }}>
          <thead>
            <tr>
              <th>ID</th><th>Name</th><th>Email</th><th>Phone</th><th>Role</th><th>Created At</th>
            </tr>
          </thead>
          <tbody>
            {caretakers.map((c) => (
              <tr key={c.id}>
                <td>{c.id}</td>
                <td>{c.name}</td>
                <td>{c.email}</td>
                <td>{c.phone}</td>
                <td>{c.role}</td>
                <td>{c.created_at}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>
    </div>
  );
}

export default App;
